query getModuleDimensionQuery($moduleId: Int!, $categoryId: Int!, $subCategoryId: Int!) {
  getModuleDimension(moduleId: $moduleId, categoryId: $categoryId, subCategoryId: $subCategoryId) {
    moduleId
    dimensionList {
      width
      depth
      height
      __typename
    }
    __typename
  }
}
